I had scanned &amp; uploaded the Rock Yearbook VI last month. Now I am uploading another one of my music yearbooks. The Smash Hits Yearbook 1986. This one covers the music scene in 1985 with acts like Eurythmics, Howard Jones, Simon Le Bon &amp; Duran Duran, Madonna, Go West, Paul Young, Wham!, Tears for Fears, Frankie Goes to Hollywood, Robert Smith, Paul Weler etc...
